{
    // Fixture setup
    var sut = new AccessibilityCollector();
    BindingFlags bindingFlags = BindingFlags.Public | BindingFlags.NonPublic | BindingFlags.Instance | BindingFlags.Static;
    var propertyInfos = typeof(object).Assembly.GetTypes().SelectMany(t => t.GetProperties(bindingFlags)).ToArray();
    var propertyInfoElement1 = propertyInfos.Where(x =>
    {
        var getMethod = x.GetGetMethod(true);
        var setMethod = x.GetSetMethod(true);
        return getMethod != null && getMethod.IsAssembly && setMethod != null && setMethod.IsPrivate;
    }).First().ToElement();
    var propertyInfoElement2 = propertyInfos.Where(x =>
    {
        var getMethod = x.GetGetMethod(true);
        var setMethod = x.GetSetMethod(true);
        return getMethod != null && getMethod.IsPublic && setMethod != null && setMethod.IsPrivate;
    }).First().ToElement();
    // Exercise system
    var actual = sut.Visit(propertyInfoElement1).Visit(propertyInfoElement2);
    // Verify outcome
    Assert.Equal(new[] { Accessibilities.Internal | Accessibilities.Private, Accessibilities.Public | Accessibilities.Private }, actual.Value.ToArray());
}

